function App() {
  return (
    <div>
      <Router>
        <Routes>
          <Route path="/" element={<Layout />}>
            <Route index element={<Home />} />
            <Route path="/calendar" element={<Calendar />}>
              <Route path="/:date" element={<DatePage />} />
            </Route>
          </Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App
